features.script:
feature.on('click',e=>{

  let r1 = {
    open: feature.createAnimation('position'),
    close: feature.createAnimation('position')
  }
  r1['open'].setKeys([{
    frame: 60,
    value: feature.position.add(new Vector3(1, 0, 0))
  }])

  r1['close'].setKeys([{
    frame: 60,
    value: feature.position.add(new Vector3(-0.01, 0, 0))
  }])
  var temp =  feature.position
  feature.startAnimations( [r1['open']] )
  setTimeout(()=>{ 
    feature.position = feature.position.add(new Vector3(1, 0, 0))
    feature.startAnimations( [r1['close']])
    feature.position = temp  
  },8000)

})

var url =["https://i.imgur.com/kNvignB.png",
