let channel1 =parcel.getFeatureById('channel1')
let channel2 =parcel.getFeatureById('channel2')
let channel3 =parcel.getFeatureById('channel3')
let channel4 =parcel.getFeatureById('channel4')
let channel5 =parcel.getFeatureById('channel5')
let channel6 =parcel.getFeatureById('channel6')

let textRemote = parcel.getFeatureById('textRemote')
let door = parcel.getFeatureById('passDoor')
var correct = "4242"
const rotation= door.get('rotation')
let open = true
let pinAudio = parcel.getFeatureById('pinAudio')


function update(num) {
  if (textRemote._content.text.length < 3) {
    var updated = textRemote._content.text.concat(num)
    textRemote.set({text: updated })
  }
  else if (textRemote._content.text.length < 4) {
    var updated = textRemote._content.text.concat(num)
    textRemote.set({text: updated })
    if (updated == correct) {
      textRemote.set({text: "GET IN THERE" })
      pinAudio.play()
      openDoor()
    }
    else {
      textRemote.set({text: "Nope" })
      closeDoor()
      setTimeout(()=>{
        textRemote.set({text: "Enter pin" })
      },500)
    }
  }
  else {
    textRemote.set({text:num})
  }
}

function select(num, channel) {

  var pos = +num-1
  console.log(pos)
  console.log(revurl[pos])
  console.log(url[pos])
  console.log(channel)

  channel.set({url:revurl[pos]})
  setTimeout(()=>{
  channel.set({url:url[pos]})
  },100)
}

function operate(num, channel) {
  select(num, channel)
  update(num)
}

function openDoor(){
  let y = rotation[1]-3.14/2
  door.set({rotation:[rotation[0],y,rotation[2]]})
  open = !open
}

function closeDoor(){
  door.set({rotation:rotation})
  open = !open
}

channel1.on('click', e=>{
  operate('1', channel1)
})

channel2.on('click', e=>{
  operate('2', channel2)
})

channel3.on('click', e=>{
  operate('3', channel3)
})

channel4.on('click', e=>{
  operate('4', channel4)
})

channel5.on('click', e=>{
  operate('5', channel5)
})

channel6.on('click', e=>{
  operate('6', channel6)
})
